/* Function  structure for function  `GetBasicByMonthYear` */

/*!50003 DROP FUNCTION IF EXISTS `GetBasicByMonthYear` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetBasicByMonthYear`(
	myMonth int(11),
	myYear int(11),
	myEmployeeID varchar(250)) RETURNS decimal(20,2)
BEGIN
	-- Function Created by Eng'r Nolan Sunico
	-- This Function is use to get the Basic Salary of each employee for month and year
	DECLARE Amount DECIMAL(20,2);
	SELECT sum(GetRegularSalary(dtr.SalaryMode,dtr.RegularRate,dtr.NumberDays,(dtr.TotNumDays-dtr.NumberDays)*dtr.RegularRate)) INTO Amount
	from dtr where month(dtr.BeginDate)=myMonth and year(dtr.BeginDate)=myYear
	and dtr.EmployeeID=myEmployeeID
	group by dtr.EmployeeID;
	RETURN ifnullVal(Amount);
	-- End Function
    END */$$
DELIMITER ;

/* Function  structure for function  `GetColaByMonthYear` */

/*!50003 DROP FUNCTION IF EXISTS `GetColaByMonthYear` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetColaByMonthYear`(
	myMonth INT(11),
	myYear INT(11),
	iEmployeeID VARCHAR(250)) RETURNS decimal(20,2)
BEGIN
	-- Function Created by Eng'r Nolan Sunico
	-- This Function is use to get the Basic Salary of each employee for month and year
	DECLARE Amount DECIMAL(20,2);
	SELECT SUM(dtr.ColaRate*dtr.NumberDays) INTO Amount
	FROM dtr
	WHERE MONTH(BeginDate)=myMonth AND YEAR(BeginDate)=myYear
	AND EmployeeID=iEmployeeID
	GROUP BY dtr.EmployeeID;
	RETURN ifnullVal(Amount);
	-- End Function
    END */$$
DELIMITER ;

/* Function  structure for function  `GetContribution` */

/*!50003 DROP FUNCTION IF EXISTS `GetContribution` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetContribution`(pDate DATE, empID varchar(250) , ConID bigint(11)) RETURNS decimal(25,8)
BEGIN
	/* Function created by Eng'r Nolan F. Sunico */
	declare EMShare decimal(10,2);
	SELECT Distinctrow employeededuction.EmployeeShare into EMShare
	FROM employeededuction, salarydeduction, contribution
	WHERE employeededuction.DeductionID = salarydeduction.DeductionID
	AND PayrollDate=pDate
	AND salarydeduction.ContributionID = contribution.ContributionID AND
        PayrollDate = pDate AND
        salarydeduction.ContributionID =ConID AND
	employeededuction.EmployeeID = empID;
	set EMShare=ifnullval(EMShare);
	return EMShare;
END */$$
DELIMITER ;

/* Function  structure for function  `GetDeductionByDate` */

/*!50003 DROP FUNCTION IF EXISTS `GetDeductionByDate` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetDeductionByDate`(
	mEmployeeID VARCHAR(250),
	mStartDate DATE,
	mEndDate DATE,
	mContributionID INT(11)) RETURNS decimal(20,2)
BEGIN
	-- Function Created by Eng'r Nolan Sunico
	-- This Function is use to get the contribution of each employee for month and year
	DECLARE Amount DECIMAL(20,2);
	SELECT SUM(employeededuction.EmployeeShare) INTO Amount
	FROM employeededuction INNER JOIN salarydeduction ON(salarydeduction.DeductionID=employeededuction.DeductionID)
	INNER JOIN contribution ON(contribution.ContributionID=salarydeduction.ContributionID)
	WHERE contribution.ContributionID=mContributionID AND employeededuction.EmployeeID=mEmployeeID
	AND PayrollDate BETWEEN mStartDate AND mEndDate; 
	-- GROUP BY MONTH(PayrollDate), employeededuction.DeductionID;
	RETURN ifnullVal(Amount);
	-- End Function
    END */$$
DELIMITER ;

/* Function  structure for function  `GetDeductionByMonthYear` */

/*!50003 DROP FUNCTION IF EXISTS `GetDeductionByMonthYear` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetDeductionByMonthYear`(
	mEmployeeID VARCHAR(250),
	myMonth INT(11), 
	myYear INT(11),
	mPayrollDate DATE,
	mContributionID INT(11)) RETURNS decimal(20,2)
BEGIN
	-- Function Created by Eng'r Nolan Sunico
	-- This Function is use to get the contribution of each employee for month and year
	DECLARE Amount DECIMAL(20,2);
	SELECT SUM(employeededuction.EmployeeShare) INTO Amount
	FROM employeededuction INNER JOIN salarydeduction ON(salarydeduction.DeductionID=employeededuction.DeductionID)
	INNER JOIN contribution ON(contribution.ContributionID=salarydeduction.ContributionID)
	WHERE MONTH(PayrollDate)=myMonth AND YEAR(payrollDate)=myYear AND contribution.ContributionID=mContributionID
	AND PayrollDate=mPayrollDate AND employeededuction.EmployeeID=mEmployeeID-- BETWEEN '2009-07-02' AND '2009-12-30'
	-- and (PayrollDate=cast(concat(myYear,'-',myMonth,'-01') as Date) or PayrollDate=CAST(CONCAT(myYear,'-',myMonth,'-08') AS DATE)
	-- or PayrollDate=CAST(CONCAT(myYear,'-',myMonth,'-16') as Date) or PayrollDate=CAST(CONCAT(myYear,'-',myMonth,'-23') as Date))
	GROUP BY MONTH(PayrollDate), employeededuction.DeductionID;
	RETURN ifnullVal(Amount);
	-- End Function
    END */$$
