/* Function  structure for function  `GetNumberOfSundays` */

/*!50003 DROP FUNCTION IF EXISTS `GetNumberOfSundays` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GetNumberOfSundays`(s date, e date) RETURNS int(11)
BEGIN
	/* This Function created by Eng'r Nolan F. Sunico March 16, 2009 ,,This Function will
	   Check how many sundays will fall on the given date range */
	declare cnSundays int;
        set cnSundays=0;
	WHILE s <= e  DO
	     if (DayName(s)='Sunday') then
		  set cnSundays=cnSundays+1;
	     end if;
	     Set s=adddate(s,1);
	END WHILE;
	return cnSundays;
    END */$$
DELIMITER ;

