DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spCreateTemporaryPayroll`()
    MODIFIES SQL DATA
BEGIN
	-- Procedure created by Eng'r Nolan Sunico
	-- September 24, 2012 - 3:19 PM
	-- The purpose of this Procedure is to generate temporary table
	-- that will be use on generating Accumulated Summary Report
	-- This Temporary table is only available from its existence
