		`Others` DECIMAL(10,2),
		`COLA` DECIMAL(10,2),
		`Deduction` DECIMAL(10,2),
		`SSS` DECIMAL(10,2),
		`Philhealth` DECIMAL(10,2),
		`Cash Advance` DECIMAL(10,2),
		`HDMFL` DECIMAL(10,2),
		`HDMFC` DECIMAL(10,2),
		`ITW` DECIMAL(10,2),
		`Housing` DECIMAL(10,2),
		`SSS Loan` DECIMAL(10,2),
		PRIMARY KEY (`ID`)
		 ) ENGINE=MEMORY;  
        -- end of Procedure  		
    END */$$
