/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateExemption`(STAT VARCHAR(250), NumOfDependent decimal(12,4))
BEGIN
	/* Stored procedure by Eng'r Nolan Sunico  */
	update exemption set ExemptionCode = Concat(left(STAT, 1), NumOfDependent) Where ExemptionStatus = STAT AND NumberOfDependent =NumOfDependent ;
